# Yurkovka, Republic of Dagestan

}}
Yurkovka () is a rural locality (a selo) and the administrative center of Yurkovsky Selsoviet, Tarumovsky District, Republic of Dagestan, Russia. Population:  There are 13 streets.
Geography
Yurkovka is located 21&nbsp;km northeast of Tarumovka (the district's administrative centre) by road. Zelyony Bugor is the nearest rural locality.
